import React, { useEffect, useState, useLayoutEffect } from 'react';
import { FaChartLine } from "react-icons/fa6";
import Carex1 from "../../assets/img/carex.png";
import CarexLogo from "../../assets/img/carex_logo.png";
import { Link, useLocation } from "react-router-dom";
import aguardar from '../../assets/img/Spin@1x-1.0s-200px-200px (1).gif';

export default function TimelineHeader() {
  const [userData, setUserData] = useState(null);
  const location = useLocation(); 

  useEffect(() => {
    // Simula o carregamento dos dados do usuário
    const fetchUserData = () => {
      setTimeout(() => {
        const dummyData = {
          company: {
            nome_empresa: 'Nome da Empresa',
          },
          entrepreneur: {
            nome: 'Nome do Empreendedor',
          },
          area_atuacao: 'Área de Atuação',
        };
        setUserData(dummyData);
      }, 1000);
    };

    fetchUserData();
  }, []);

  if (!userData) {
    return (
      <div className="loading-container flex justify-center items-center h-screen">
        <img src={aguardar} alt="Loading..." className="loading-gif" />
      </div>
    );
  }

  const { company, entrepreneur } = userData;
  const displayName = company ? company.nome_empresa : (entrepreneur ? entrepreneur.nome : 'Nome não disponível');

  // Move o useLayoutEffect para fora da condição if
  useLayoutEffect(() => {
    const postagensLink = document.querySelector('.postagens-link'); // Seleciona o link de postagens
    const conexoesLink = document.querySelector('.conexoes-link'); // Seleciona o link de conexões
    const viewsLink = document.querySelector('.views-link'); // Seleciona o link de visualizações
    const servicesLink = document.querySelector('.services-link'); // Seleciona o link de serviços
    const dashboardLink = document.querySelector('.dashboard-link'); // Seleciona o link do dashboard

    if (postagensLink && conexoesLink && viewsLink && servicesLink && dashboardLink) { // Verifica se os links foram encontrados
      if (location.pathname === '/') {
        postagensLink.classList.add('active');
        conexoesLink.classList.remove('active');
        viewsLink.classList.remove('active');
        servicesLink.classList.remove('active');
        dashboardLink.classList.remove('active');
      } else if (location.pathname === '/connections') {
        postagensLink.classList.remove('active');
        conexoesLink.classList.add('active');
        viewsLink.classList.remove('active');
        servicesLink.classList.remove('active');
        dashboardLink.classList.remove('active');
      } else if (location.pathname === '/views') {
        postagensLink.classList.remove('active');
        conexoesLink.classList.remove('active');
        viewsLink.classList.add('active');
        servicesLink.classList.remove('active');
        dashboardLink.classList.remove('active');
      } else if (location.pathname === '/services') {
        postagensLink.classList.remove('active');
        conexoesLink.classList.remove('active');
        viewsLink.classList.remove('active');
        servicesLink.classList.add('active');
        dashboardLink.classList.remove('active');
      } else if (location.pathname === '/dashboard') {
        postagensLink.classList.remove('active');
        conexoesLink.classList.remove('active');
        viewsLink.classList.remove('active');
        servicesLink.classList.remove('active');
        dashboardLink.classList.add('active');
      }
    }
  }, [location.pathname]); 

  return (
    <div className="px-full sm:px-2 shadow">
      <div className="relative h-96 rounded-b flex justify-center">
        <img
          src={Carex1}
          className="object-cover w-full h-full rounded-b"
          alt="cover"
        />
        <div className="absolute -bottom-6 sm:left-6 -bottom-16">
          <img
            src={CarexLogo}
            className="object-cover border-2 border-gray-900 w-40 h-40 rounded-full"
            alt="cover"
          />
        </div>
      </div>
      <div className="flex justify-between mt-9">
        <div className="text-center mt-6 mx-3 text-3xl font-bold text-fBlack justify-center">
          <p>{displayName}</p>
          <p className="font-normal text-sm">{userData.area_atuacao}</p>
        </div>
        <div className="text-center mt-6 text-3xl font-bold text-fBlack justify-center">
          <Link to={"/editprofile"} className="text-sm text-fGrey bg-blue-500 px-2 py-1 rounded">Editar perfil</Link>
        </div>
      </div>
      <div className="border border-fGrey mt-6 border-opacity-10" />
      <div className="flex justify-between dmd:px-4 sm:px-8">
        <div className="flex items-center">
          <div className={`px-2 text-fBlue border-b-4 border-fBlue md:px-4 py-5 ${location.pathname === '/' ? 'active' : ''}`}> 
            <Link to="/" className='postagens-link'>Postagens</Link>
          </div>
          <div className={`px-1 py-5 text-fGrey md:px-4 ${location.pathname === '/connections' ? 'active' : ''}`}> 
            <Link to="/connections" className='conexoes-link'>Conexões</Link>
          </div>
          <div className={`px-1 py-5 text-fGrey md:px-4 ${location.pathname === '/views' ? 'active' : ''}`}> 
            <Link to="/views" className='views-link'>Visualizações</Link>
          </div>
          <div className={`px-1 py-5 text-fGrey md:px-4 ${location.pathname === '/services' ? 'active' : ''}`}> 
            <Link to="/services" className='services-link'>Serviços</Link>
          </div>
        </div>
        <div className="flex items-center space-x-2 mr-2">
          <div className={`px-1 py-5 text-fGrey md:px-4 ${location.pathname === '/dashboard' ? 'active' : ''}`}>
            <Link to="/dashboard" className="flex items-center justify-center focus:outline-none dashboard-link">
              <FaChartLine /> <span className="ml-1">Dashboard</span>
            </Link>
          </div>
        </div>
      </div>
    </div>
  );
}
